func lengthOfLongestSubstring(s string) int {
	var result int
	result = helper(s)

	for i, _ := range s {
		var newstring string
		for j := i; j < len(s); j++ {
			newstring = fmt.Sprint(newstring + string(s[j]))
		}
		fmt.Println("i = ", i, newstring)

		if helper(newstring) > result {
			result = helper(newstring)
		}
	}

	return result

}

func helper(s string) int {
	if s == "" {
		return 0
	}

	substring := []string{"none"}

	var result []string

	for i, char := range s {
		if i == 0 {
			substring[0] = string(s[0])
			continue
		}

		success := true
		for _, subchar := range substring {

			if subchar == string(char) {

				success = false

				if len(substring) > len(result) {
					result = substring
					substring = []string{}
					substring = append(substring, string(s[i]))
				}

				substring = []string{}
				substring = append(substring, string(s[i]))
				break
			}
		}

		if success {
			substring = append(substring, string(char))
		}
	}

	if len(substring) > len(result) {
		result = substring
	}
	fmt.Println("result: ", result)

	fmt.Println("substring: ", substring)
	return len(result)
}
